B.H1=new A.v1("\uadf8 \ub9d0\uc500\uc744 \ub2e4 \uae30\ub85d\ud574 \ub193\uc73c\uba74 \ud2b9\ubcc4\ud788 \uc911\uc694\ud55c \ub0a0\uc758 \ub9d0\uc500\uc744 \uae30\ub85d\ud574 \ub193\uc73c\uba74 \ub098\uc911\uc5d0 \uac04\uc99d\ud560 \ub54c \ud06c\uac8c \uc4f0\uc784\uc744 \ubc1b\uc744 \uac83\uc785\ub2c8\ub2e4. \n\u300a\uacf5\ub3d9\uccb4 \uace0\ubc31\u300b \n\uc21c\uac04\ub9c8\ub2e4 \ub9c8\ub545\ud788 \ud560 \ub9d0\uc744 \uc8fc\uc2dc\ub294 \uc131\ub839\ub2d8\uc744 \uc758\uc9c0\ud558\uc5ec \uc0ac\ub78c\ub4e4\uc744 \uc9c0\ud61c\ub86d\uac8c \ub300\ud558\uae30 \uc6d0\ud55c\ub2e4\ub294 \ud55c \ubaa9\uc0ac\ub2d8\uc758 \ud050\ud2f0\uc778 \ubb35\uc0c1 \uac04\uc99d\uc774\uc5d0\uc694. \n\ubd88\uc2e0 \uac00\uc815\uc5d0\uc11c \ud0dc\uc5b4\ub09c \uc800\ub294 \uccad\uc18c\ub144\uae30\uc5d0 \uce5c\uad6c\ub4e4\uc758 \uc778\ub3c4\ub85c \uad50\ud68c \ub2e4\ub2c8\uac8c \ub418\uc5c8\uc5b4\uc694. \uc774\ud6c4 \ubaa9\ud68c\uc790\ub85c \ubd80\ub974\uc2ec \ubc1b\uace0 \uad70\uc81c\ub300 \ud6c4 \uc2e0\ud559\ub300\ud559\uc6d0\uc5d0 \uc9c4\ud559\ud588\uc9c0\uc694. \n\uadf8\ub7f0\ub370 \uc2e0\ud559\uad50\ub294 \uadf8\ub3d9\uc548 \uc81c\uac00 \uacbd\ud5d8\ud574 \uc628 \uad50\ud68c\uc640 \ubd84\uc704\uae30\uac00 \uc0ac\ubb47 \ub2ec\ub790\uc5b4\uc694. \uae30\ub3c5\uad50\uacc4\uc758 \ubd88\ubbf8\uc2a4\ub7ec\uc6b4 \ub274\uc2a4\uc640 \uc720\uba85 \ubaa9\ud68c\uc790\ub4e4\uc5d0 \ub300\ud55c \ub4b7 \uc774\uc57c\uae30\ub97c \ub4e3\uac8c \ub418\ub2c8 \ub9c8\uc74c\uc774 \ubd88\ud3b8\ud560 \ub54c\uac00 \ub9ce\uc558\uc9c0\uc694. \n\uac8c\ub2e4\uac00 \uc804\ub3c4\uc0ac\ub85c \uc0ac\uc5ed\ud560 \ub54c\ub294 \ubaa9\ud68c \ud604\uc7a5\uc744 \ubcf4\uba70 \uc790\uad34\uac10\uc5d0 \ube60\uc9c0\uae30\ub3c4 \ud588\uc5b4\uc694. \uc2dc\ud5d8\uc5d0 \ub4e4\uc5b4 \uad50\ud68c\ub97c \uc62e\uaca8\uc628 \ubd84\ub4e4 \ub3d9\uc5ed\ud558\ub294 \ubaa9\ud68c\uc790\ub4e4\uc758 \uc628\uc804\ud558\uc9c0 \ubabb\ud55c \uc5b8\ud589, \uad50\ud68c \ub0b4\uc758 \uc2dc\uae30\uc640 \ub2e4\ud23c \ub4f1\uc744 \ubcf4\uba70 \ub9c8\uce58 \uc81c\uac00 \uc774\ub9ac \uac00\uc6b4\ub370 \uc788\ub294 \uac83\ucc98\ub7fc \ub290\uaef4\uc84c\uc9c0\uc694. \n\uadf8\ub7f0\ub370 \uc624\ub298 16\uc808\uc5d0 \uadf8\ub7ec\ubbc0\ub85c \ub108\ud76c\ub294 \ubc40 \uac19\uc774 \uc9c0\ud61c\ub86d\uace0 \ube44\ub458\uae30\uac19\uc774 \uc21c\uacb0\ud558\ub77c\ub294 \ub9d0\uc500\uc744 \ubb35\uc0c1\ud558\ub2e4\uac00 \uc81c\uac8c \uc0ac\ub78c\ub4e4\uc744 \ub300\ud558\ub294 \uc9c0\ud61c\uac00 \ubd80\uc871\ud588\uc74c\uc744 \uae68\ub2eb\uac8c \ub418\uc5c8\ub2f5\ub2c8\ub2e4. \n\uadf8\ub9ac\uc2a4\ub3c4\uc778\uc73c\ub85c\uc11c \ub610 \ubaa9\ud68c\uc790\ub85c\uc11c \ub9d0\uc500\uc73c\ub85c \uba3c\uc800 \ub0b4 \uc8c4\ub97c \ubcf4\uace0 \uc0ac\ub78c\uc744 \ubbff\uc74c\uc758 \ub300\uc0c1\uc774 \uc544\ub2cc \uc0ac\ub791\uc758 \ub300\uc0c1\uc73c\ub85c \ub300\ud574\uc57c \ud568\uc744 \uc54c\uac8c \ub41c \uac83\uc774\uc8e0. \n\uadf8\ub3d9\uc548 \uc800\ub294 \uc131\ub839\ub2d8\uc774 \uc8fc\uc2dc\ub294 \ub9d0\uc500\uc774 \uc544\ub2c8\ub77c \uc0ac\ub78c\uc758 \ub9d0\uacfc \ud589\ub3d9\uc5d0 \ub3d9\uc870\ud558\uc5ec \ub9de\uc7a5\uad6c\ub97c \uce58\uace0 \uc9d1\uc73c\ub85c \ub3cc\uc544\uc624\ub294 \uae38\uc5d0 \ub4a4\ub2a6\uac8c \ud6c4\ud68c\ud558\uace4 \ud588\uc5b4\uc694. \n\uac00\uc7a5 \uc545\ud55c \uc6d0\uc218\ub294 \ub2e4\ub984 \uc544\ub2cc \uc774\ub7f0 \uc800 \uc790\uc2e0\uc784\uc744 \uace0\ubc31\ud558\uba70 \ud68c\uac1c\ud569\ub2c8\ub2e4. \uc21c\uac04\ub9c8\ub2e4 \ub9c8\ub545\ud788 \ud560 \ub9d0\uc744 \uc8fc\uc2dc\ub294 \uc131\ub839\ub2d8\uc744 \uc758\uc9c0\ud558\uc5ec \uc0ac\ub78c\ub4e4\uc744 \uc9c0\ud61c\ub86d\uac8c \ub300\ud560 \uc218 \uc788\uae30\ub97c \uae30\ub3c4\ud574\uc694. \n\uc800\uc758 \uc801\uc6a9\uc740 \n\ubaa9\ud68c\uc790\ub4e4\uc774\ub098 \uc131\ub3c4\ub4e4\uc744 \uc9c0\ud61c\ub86d\uac8c \ub300\ud558\uace0 \ud560 \ub9d0\uc740 \uc131\ub839\uc774 \uc8fc\uc2e0\ub2e4\ub294 \uc0ac\uc2e4\uc744 \uc78a\uc9c0 \uc54a\uaca0\uc2b5\ub2c8\ub2e4. \n\uc774\uc804 \uad50\ud68c\uc5d0\uc11c \ubc1b\uc740 \uc0c1\ucc98\ub85c \ud798\ub4e4\uc5b4\ud558\ub294 \uccad\ub144\uc744 \ub9d0\uc500\uc73c\ub85c \uc704\ub85c\ud558\uaca0\uc2b5\ub2c8\ub2e4. \n\uc624\ub298 21\uc808\uacfc 22\uc808\uc5d0 \uc7a5\ucc28 \ud615\uc81c\uac00 \ud615\uc81c\ub97c \uc544\ubc84\uc9c0\uac00 \uc790\uc2dd\uc744 \uc8fd\ub294 \ub370\uc5d0 \ub0b4\uc8fc\uba70 \uc790\uc2dd\ub4e4\uc774 \ubd80\ubaa8\ub97c \ub300\uc801\ud558\uc5ec \uc8fd\uac8c \ud558\ub9ac\ub77c \ub610 \ub108\ud76c\uac00 \ub0b4 \uc774\ub984\uc73c\ub85c \ub9d0\ubbf8\uc554\uc544 \ubaa8\ub4e0 \uc0ac\ub78c\uc5d0\uac8c \ubbf8\uc6c0\uc744 \ubc1b\uc744 \uac83\uc774\ub098 \ub05d\uae4c\uc9c0 \uacac\ub514\ub294 \uc790\ub294 \uad6c\uc6d0\uc744 \uc5bb\uc73c\ub9ac\ub77c\uace0 \ud558\uc138\uc694. \n\uc608\uc218\ub2d8\uc744 \ubbff\ub294\ub2e4\ub294 \uac83\uc740 \uc2ed\uc790\uac00\ub97c \uc9c0\ub294 \uc0b6\uc785\ub2c8\ub2e4. \uadf8\ub7ec\ub098 \uc138\uc0c1\uc740 \uc2ed\uc790\uac00\ub97c \uc54c \uc218 \uc5c6\uae30\uc5d0 \uc608\uc218 \ubbff\ub294 \uc0ac\ub78c\uc744 \ubbf8\uc6cc\ud569\ub2c8\ub2e4. \n\uc545\ud558\uace0 \uc74c\ub780\ud55c \uc138\uc0c1\uc5d0\uc11c \uc138\uc0c1\uacfc \ud0c0\ud611\ud558\uc9c0 \uc54a\uace0 \uc0ac\ub294 \uac83\uc774 \ubbf8\uc6c0\ubc1b\uc744 \uc77c\uc774\uae30 \ub54c\ubb38\uc774\uc9c0\uc694. \uadf8\uac83\uc774 \ud798\ub4e0 \uac83\uc744 \uc544\uc2dc\uae30\uc5d0 \uc8fc\ub2d8\uc740 \ub05d\uae4c\uc9c0 \uacac\ub514\ub294 \uc790\ub294 \uad6c\uc6d0\uc744 \uc5bb\uc744 \uac83\uc774\ub77c\uace0 \uc57d\uc18d\ud574 \uc8fc\uc2ed\ub2c8\ub2e4. \n\uadf8\ub9ac\uace0 23\uc808\uc5d0 \uc774 \ub3d9\ub124\uc5d0\uc11c \ub108\ud76c\ub97c \ubc15\ud574\ud558\uac70\ub4e0 \uc800 \ub3d9\ub124\ub85c \ud53c\ud558\ub77c\uace0 \ud558\uc138\uc694. \n\uace0\ub9b0\ub3c4\uc804\uc11c 10\uc7a5 13\uc808\uc5d0\uc11c \uc0ac\ub3c4\ubc14\uc6b8\uc740 \uc0ac\ub78c\uc774 \uac10\ub2f9\ud560 \uc2dc\ud5d8\ubc16\uc5d0\ub294 \ub108\ud76c\uac00 \ub2f9\ud55c \uac83\uc774 \uc5c6\ub098\ub2c8 \uc624\uc9c1 \ud558\ub098\ub2d8\uc740 \ubbf8\ubfcc\uc0ac \ub108\ud76c\uac00 \uac10\ub2f9\ud558\uc9c0 \ubabb\ud560 \uc2dc\ud5d8\ub2f9\ud568\uc744 \ud5c8\ub77d\uc9c0 \uc544\ub2c8\ud558\uc2dc\uace0, \uc2dc\ud5d8\ub2f9\ud560\ucbe4\uc5d0 \ub610\ud55c \ud53c\ud560 \uae38\uc744 \ub0b4\uc0ac \ub108\ud76c\ub85c \ub2a5\ud788 \uac10\ub2f9\ud558\uac8c \ud558\uc2dc\ub290\ub2c8\ub77c\uace0 \ud588\uc9c0\uc694. \n\uc6b0\ub9ac\uac00 \ud53c\ud560 \uacf3\uc740 \ud658\uacbd\uc774 \uc544\ub2d9\ub2c8\ub2e4. \ud558\ub098\ub2d8 \ub098\ub77c\uc640 \uc608\uc218\ub2d8\uc774 \uc6b0\ub9ac\uac00 \uac00\uc7a5 \uc548\uc804\ud558\uac8c \ud53c\ud560 \uacf3\uc785\ub2c8\ub2e4. \n\uc81c\uac00 \uacb0\ud63c \ucd08\uc5d0 \uc2dc\uc9d1\uc0b4\uc774 \ud558\uba74\uc11c \uacac\ub514\uae30 \ud798\ub4e4\uc5c8\ub358 \uc774\uc720\ub294 \uc81c\uac8c \ub2a5\ub825\uc774 \uc788\uc5c8\uae30 \ub54c\ubb38\uc774\uc5c8\uc8e0. \uc774\ud63c\ud574\ub3c4 \ud53c\uc544\ub178 \ub808\uc2a8\ud558\uba74\uc11c \uc798 \uc0b4\uace0 \uc7ac\ud63c\ub3c4 \ud560 \uc218 \uc788\uc744 \uac83 \uac19\uc558\uc8e0. \n\uadf8\ub798\uc11c \uc774\ud63c\uc73c\ub85c \ud53c\ud558\uace0 \uc2f6\uc5c8\uc8e0. \uadf8\uac83\uc740 \ud53c\ud560 \uae38\uc774 \uc544\ub2cc\ub370 \ub9d0\uc774\uc8e0. \ub300\ud559\uc6d0\uc5d0 \uac00\uc11c \uc74c\ub300 \uad50\uc218\uc758 \uae38\ub85c \ud53c\ud558\uace0\ub3c4 \uc2f6\uc5c8\uc9c0\ub9cc \uadf8\uac83\ub3c4 \ud53c\ud560 \uae38\uc774 \uc544\ub2c8\uc5c8\uc5b4\uc694. \uc624\uc9c1 \uc608\uc218\ub2d8\ub9cc\uc774 \uc2dc\ud5d8\ub2f9\ud560\ucbe4\uc5d0 \ud53c\ud560 \uae38\uc744 \ub0b4\uc0ac \uadf8 \ud53c\ud560 \uae38\uc774 \uc608\uc218\ub2d8\uc774\uc5d0\uc694. the way \n\uadfc\ub370 \ub4dc\ub514\uc5b4 \uadf8 \uc608\uc218\ub2d8\uc774 \uc800\uc758 \ud53c\ud560 \uae38\uc774 \ub418\uc5b4 \uc8fc\uc168\uc5b4\uc694. \ud558\ub098\ub2d8\uc740 \ub54c\ub9c8\ub2e4 \ub9d0\uc500\uc744 \uc8fc\uc154\uc11c \uacac\ub514\uac8c \ud558\uc2dc\uace0 \uacb0\uad6d \ub0a8\ud3b8\uc758 \uad6c\uc6d0\ub3c4 \uc774\ub8e8\uc5b4\uc8fc\uc168\uc2b5\ub2c8\ub2c8\ub2e4. \uc138\uc0c1\uc5d0\uc11c \uac00\uc7a5 \uc9c0\ud0ac \ub9cc\ud55c \ucd5c\uace0\uc758 \uac00\uce58\uac00 \uc788\ub294 \uac83\uc774 \ubc14\ub85c \uac00\uc815\uc774\uac70\ub4e0\uc694. \n\ud560\ub810\ub8e8\uc57c !!!\xa0 \uc0ac\ub791\ud558\ub294 \uc5ec\ub7ec\ubd84 \ube44\ub85d \uc9c0\uae08 \ud798\ub4e4\uace0 \uace0\ub41c \uc790\ub9ac\uc5d0 \uc788\ub354\ub77c\ub3c4 \ub0a0\ub9c8\ub2e4 \ub9d0\uc500\uc744 \ud1b5\ud574 \uc608\uc218\uaed8\ub85c \ud53c\ud558\uace0 \ub05d\uae4c\uc9c0 \uacac\ub38c\uc11c \uaf2d \uc57d\uc18d\ud558\uc2e0 \uad6c\uc6d0\uc744 \ub2e4 \ubc1b\uc73c\uc2dc\uae38 \uac04\uc808\ud788 \ubc14\ub78d\ub2c8\ub2e4. \n\uae30\ub3c4\ub4dc\ub9bd\ub2c8\ub2e4. \ud558\ub098\ub2d8 \n\uc608\uc218 \ubbff\ub294 \uac83\uc774 \uc774 \ub545\uc5d0\uc11c\ub294 \ubc15\ud574\ubc1b\ub294 \uc0b6\uc774\ub77c\uace0 \ud558\uc2ed\ub2c8\ub2e4. \uadf8\ub7f0\ub370 \uadf8 \ud54d\ubc15\uc774 \uac00\uae4c\uc6b4 \uc0ac\ub78c\ub4e4\uc5d0\uac8c \ub2f9\ud558\ub294 \uac83\uc774\uae30\uc5d0 \ub354 \uc544\ud504\uace0 \ud798\uc774 \ub4e4 \ub54c\uac00 \uc788\uc74c\uc744 \uace0\ubc31\ud569\ub2c8\ub2e4. \n\ub610 \ub0b4 \uc695\uc2ec\uacfc \ub0b4 \uac10\uc815\uc73c\ub85c \uc0ac\ub78c\uc744 \uc0bc\uac00\uc9c0 \ubabb\ud560 \ub54c\ub3c4 \ub9ce\uc774 \uc788\uc2b5\ub2c8\ub2e4. \uc8fc\uc5ec \ubd88\uc30d\ud788 \uc5ec\uaca8\uc8fc\uc2dc\uc635\uc18c\uc11c. \n\uc800\ud76c\uc758 \ubaa8\ub4e0 \ud658\uacbd\uc774 \ubcf5\uc74c\uc744 \uc804\ud560 \ud658\uacbd\uc73c\ub85c \uc4f0\uc784\ubc1b\uac8c \ub3c4\uc640\uc8fc\uc2dc\uace0, \ub099\uc2ec\ud558\uc9c0 \uc54a\uace0, \uc774 \uc740\ud61c\uc758 \ubcf5\uc74c\uc744 \uc804\ud560 \uc218 \uc788\ub3c4\ub85d \ud798 \uc8fc\uc2dc\uc635\uc18c\uc11c. \n\ucc38\uc73c\ub85c \uad6c\uc6d0\uc744 \uc704\ud574 \ubc40\uac19\uc774 \uc9c0\ud61c\ub86d\uace0 \ube44\ub458\uae30\uac19\uc774 \uc21c\uacb0\ud55c \uc0b6\uc744 \uc0b4\uac8c \ub3c4\uc640\uc8fc\uc2dc\uc635\uc18c\uc11c. \uc624\ub298 \ub05d\uae4c\uc9c0 \uacac\ub514\ub294 \uc790\ub294 \uad6c\uc6d0\uc744 \uc5bb\uc744 \uac83\uc774\ub77c\uace0 \ud558\uc2dc\ub2c8 \uadf8 \uc57d\uc18d\uc744 \ubbff\uace0 \uac78\uc5b4\uac00\uae30\ub97c \uc6d0\ud569\ub2c8\ub2e4. \n\uc774\uc81c\ub294 \ud658\uacbd\uc774 \uc544\ub2c8\ub77c \uc608\uc218\uaed8\ub85c \ud53c\ud558\ub294 \uc800\ud76c\uac00 \ub2e4 \ub420 \uc218 \uc788\ub3c4\ub85d \uc8fc\uc5ec \ub0a0\ub9c8\ub2e4 \ub9d0\uc500\uc73c\ub85c \uc778\ub3c4\ud574 \uc8fc\uc2dc\uc635\uc18c\uc11c \n\uc608\uc218 \uadf8\ub9ac\uc2a4\ub3c4\uc758 \uc774\ub984\uc73c\ub85c \uae30\ub3c4\ub4dc\ub9ac\uc635\ub098\uc774\ub2e4. \uc544\uba58!! \n\uc8fc\uc77c\uc608\ubc30 <\uc9c0\uae08 \ub9cc\ub098\ub7ec \uac11\ub2c8\ub2e4_\uc2e0\uc2b9\uc724 \ubaa9\uc0ac>\u2698\ufe0f\nhttps://youtu.be/V3BKdYJzy1c \n0125\ud050\ud2f0\ub178\ud2b8\ud83c\udf81\nhttps://youtu.be/Lc-7pwe19rE \n\uae40\uc591\uc7ac \ubaa9\uc0ac\uc758 ost <\uc0b4\ub9ac\ub294 \ud310\ub2e8,\uc8fd\uc774\ub294 \ud310\ub2e8>\ud83d\udd14\nhttps://youtu.be/A755WaXX-7w \n\uae40\uc591\uc7ac \ubaa9\uc0ac\uc758 \uc911\ubcf4\uae30\ub3c4#69 \ub3c4\uc6b0\uc2ec\ud83d\udcab\nhttps://youtu.be/svcy5tCNrKM \n\uc0c8\ub86d\uac8c \ud558\uc18c\uc11c_\uc6b0\ub9ac\ub4e4\uad50\ud68c \uae40\uc591\uc7ac\ubaa9\uc0ac\n<\ub098\ub294 \uc545\ud558\uace0 \uc74c\ub780\ud569\ub2c8\ub2e4>\ud83c\udf08\nhttps://youtu.be/57EkBBA1qNY",null)
